import React, {Fragment} from 'react';
import { Link } from 'react-router-dom';
import Img_Croix from './img/croix.png' 
import Burger from './img/burger.png' 
import Redirection_informations_pratiques from './Redirection_informations_pratiques'

function Navigation(burger){

    // function Menu_visible(){
    //     (1 == 2 ) ? burger = document.getElementById('rien').style.display = "none" : burger = document.getElementById('rien').style.display = "inline"
    // }

    return(
        <Fragment>
            {/* <img className="imgBurger" src={Img_Croix} /> */}

            {/* <img onClick={ Menu_visible } id="rien" className="imgBurger" src={Burger}/> */}

            <ul className="menu_ul">
                <Link to="/">
                    <li className="menu">Accueil</li>
                </Link>
                <Link to="/Sponsors">
                    <li className="menu">Sponsors</li>
                </Link>
                <Link to="/Informations_pratiques">
                    <li className="menu">Informations pratiques</li>
                </Link>
                <Link to="/Informations">
                    <li className="menu">Informations</li>
                </Link>
                <Link to="/Billeterie_page">
                    <li className="menu">Billeterie</li>
                </Link>
                <Link to="/Direct_page">
                    <li className="menu">Direct_page</li>
                </Link>
                <hr className="hr_menu" />
                
                <div className="menu">
                <Link to ="Informations_pratiques">
                <p className="info_redirect" >Toutes les informations pratiques</p> 
            </Link>                 
            </div>

                
            </ul>
        </Fragment>
    )
}

export default Navigation
